    [],nt"revision_timestamp": "2016-10-08T15:56:10.037694",nt"name": "bird-species-composition-and-abundance-in-two-riparian-areas-with-differing-grazing-histor",nt"isopen":
    false,nt"url": null,nt"notes": "This paper reports the results of a breeding
    bird survey conducted in June 1994 in Siparyann Creek drainage and Rock Creek drainage
    within Charles M. Russell National Wildlife Refuge. Siparyann Creek has a long history
    of intense livestock grazing, and Rock Creek has a varied history of livestock grazing
    which includes no grazing since 1991 on its upper portion and spring grazing on
    its lower portion. The drainages have identical riparian zone potential but supportnstrikingly
    different riparian habitat, presumably resulting from different grazing histories.
     This report discusses the results of breeding bird transects  conducted within
    these drainages, and the relationship between bird species and relative abundance
    and grazing intensity.",nt"license_title": "License Not Specified",nt"extras":
